function FilterContainer() {
    const srcList =[
    "/images/전체.svg",
    "/images/브랜드.svg"
  ];

  return (
    <div>
    <ul className="Filter_container">
    {FilterButton(srcList[0])}
    <p>타입 종류</p>
      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
    </ul>
  </div>
);
}

export default FilterContainer;

